	module.exports = [{"id":"CCSS.Math.Content.HSA.APR.A.1","name":"CCSS.Math.Content.HSA.APR.A.1","body":"Understand that polynomials form a system analogous to the integers, namely, they are closed under the operations of addition, subtraction, and multiplication; add, subtract, and multiply polynomials.\n\nCluster: Perform arithmetic operations on polynomials\nBig Ideas Algebra 1 Chapters: 7.1, 7.2, 7.3\nCodes: CCSS.Math.Content.HSA-APR.A.1, CCSS.Math.Content.HSA.APR.A.1, A-APR.1\n"},{"id":"CCSS.Math.Content.HSA.APR.B.2","name":"CCSS.Math.Content.HSA.APR.B.2","body":"Know and apply the Remainder Theorem: For a polynomial p(x) and a number a, the remainder on division by x - a is p(a), so p(a) = 0 if and only if (x - a) is a factor of p(x).\n\nCluster: Understand the relationship between zeros and factors of polynomials\nCodes: CCSS.Math.Content.HSA-APR.B.2, CCSS.Math.Content.HSA.APR.B.2, A-APR.2\n"},{"id":"CCSS.Math.Content.HSA.APR.B.3","name":"CCSS.Math.Content.HSA.APR.B.3","body":"Identify zeros of polynomials when suitable factorizations are available, and use the zeros to construct a rough graph of the function defined by the polynomial.\n\nCluster: Understand the relationship between zeros and factors of polynomials\nBig Ideas Algebra 1 Chapters: 7.4, 8.5\nCodes: CCSS.Math.Content.HSA-APR.B.3, CCSS.Math.Content.HSA.APR.B.3, A-APR.3\n"},{"id":"CCSS.Math.Content.HSA.APR.C.4","name":"CCSS.Math.Content.HSA.APR.C.4","body":"Prove polynomial identities and use them to describe numerical relationships. For example, the polynomial identity (x^2 + y^2)^2 = (x^2 - y^2)^2 + (2xy)^2 can be used to generate Pythagorean triples.\n\nCluster: Use polynomial identities to solve problems\nCodes: CCSS.Math.Content.HSA-APR.C.4, CCSS.Math.Content.HSA.APR.C.4, A-APR.4\n"},{"id":"CCSS.Math.Content.HSA.APR.C.5","name":"CCSS.Math.Content.HSA.APR.C.5","body":"(+) Know and apply the Binomial Theorem for the expansion of (x + y)^n in powers of x and y for a positive integer n, where x and y are any numbers, with coefficients determined for example by Pascal's Triangle.\n\nCluster: Use polynomial identities to solve problems\nCodes: CCSS.Math.Content.HSA-APR.C.5, CCSS.Math.Content.HSA.APR.C.5, A-APR.5\n"},{"id":"CCSS.Math.Content.HSA.APR.D.6","name":"CCSS.Math.Content.HSA.APR.D.6","body":"Rewrite simple rational expressions in different forms; write a(x)/b(x) in the form q(x) + r(x)/b(x), where a(x), b(x), q(x), and r(x) are polynomials with the degree of r(x) less than the degree of b(x), using inspection, long division, or, for the more complicated examples, a computer algebra system.\n\nCluster: Rewrite rational expressions\nCodes: CCSS.Math.Content.HSA-APR.D.6, CCSS.Math.Content.HSA.APR.D.6, A-APR.6\n"},{"id":"CCSS.Math.Content.HSA.APR.D.7","name":"CCSS.Math.Content.HSA.APR.D.7","body":"(+) Understand that rational expressions form a system analogous to the rational numbers, closed under addition, subtraction, multiplication, and division by a nonzero rational expression; add, subtract, multiply, and divide rational expressions.\n\nCluster: Rewrite rational expressions\nCodes: CCSS.Math.Content.HSA-APR.D.7, CCSS.Math.Content.HSA.APR.D.7, A-APR.7\n"},{"id":"CCSS.Math.Content.HSA.APR","name":"CCSS.Math.Content.HSA.APR","body":"Other codes: CCSS.Math.Content.HSA-APR, CCSS.Math.Content.HSA.APR, A-APR\nwith Polynomials and Rational Expressions "},{"id":"CCSS.Math.Content.HSA.CED.A.1","name":"CCSS.Math.Content.HSA.CED.A.1","body":"Create equations and inequalities in one variable and use them to solve problems. Include equations arising from linear and quadratic functions, and simple rational and exponential functions.\n\nCluster: Create equations that describe numbers or relationships\nBig Ideas Algebra 1 Chapters: 1.1, 1.2, 1.3, 1.4, 2.1, 2.2, 2.3, 2.4, 2.5, 2.6, 6.5, 9.3, 9.4, 9.5, 10.3\nCodes: CCSS.Math.Content.HSA-CED.A.1, CCSS.Math.Content.HSA.CED.A.1, A-CED.1\n"},{"id":"CCSS.Math.Content.HSA.CED.A.2","name":"CCSS.Math.Content.HSA.CED.A.2","body":"Create equations in two or more variables to represent relationships between quantities; graph equations on coordinate axes with labels and scales.\n\nCluster: Create equations that describe numbers or relationships\nBig Ideas Algebra 1 Chapters: 3.2, 3.3, 3.4, 3.5, 3.7, 4.1, 4.2, 4.3, 4.7, 6.3, 6.4, 8.1, 8.2, 8.3, 8.4, 8.5, 10.1, 10.2\nCodes: CCSS.Math.Content.HSA-CED.A.2, CCSS.Math.Content.HSA.CED.A.2, A-CED.2\n"},{"id":"CCSS.Math.Content.HSA.CED.A.3","name":"CCSS.Math.Content.HSA.CED.A.3","body":"Represent constraints by equations or inequalities, and by systems of equations and/or inequalities, and interpret solutions as viable or nonviable options in a modeling context. For example, represent inequalities describing nutritional and cost constraints on combinations of different foods.\n\nCluster: Create equations that describe numbers or relationships\nBig Ideas Algebra 1 Chapters: 5.1, 5.2, 5.3, 5.4, 5.5, 5.6, 5.7\nCodes: CCSS.Math.Content.HSA-CED.A.3, CCSS.Math.Content.HSA.CED.A.3, A-CED.3\n"},{"id":"CCSS.Math.Content.HSA.CED.A.4","name":"CCSS.Math.Content.HSA.CED.A.4","body":"Rearrange formulas to highlight a quantity of interest, using the same reasoning as in solving equations. For example, rearrange Ohm's law V = IR to highlight resistance R.\n\nCluster: Create equations that describe numbers or relationships\nBig Ideas Algebra 1 Chapters: 1.5, 9.3\nCodes: CCSS.Math.Content.HSA-CED.A.4, CCSS.Math.Content.HSA.CED.A.4, A-CED.4\n"},{"id":"CCSS.Math.Content.HSA.CED","name":"CCSS.Math.Content.HSA.CED","body":"Other codes: CCSS.Math.Content.HSA-CED, CCSS.Math.Content.HSA.CED, A-CED\nEquations"},{"id":"CCSS.Math.Content.HSA.REI.A.1","name":"CCSS.Math.Content.HSA.REI.A.1","body":"Explain each step in solving a simple equation as following from the equality of numbers asserted at the previous step, starting from the assumption that the original equation has a solution. Construct a viable argument to justify a solution method.\n\nCluster: Understand solving equations as a process of reasoning and explain the reasoning\nBig Ideas Algebra 1 Chapters: 1.1, 6.5\nCodes: CCSS.Math.Content.HSA-REI.A.1, CCSS.Math.Content.HSA.REI.A.1, A-REI.1\n"},{"id":"CCSS.Math.Content.HSA.REI.A.2","name":"CCSS.Math.Content.HSA.REI.A.2","body":"Solve simple rational and radical equations in one variable, and give examples showing how extraneous solutions may arise.\n\nCluster: Understand solving equations as a process of reasoning and explain the reasoning\nCodes: CCSS.Math.Content.HSA-REI.A.2, CCSS.Math.Content.HSA.REI.A.2, A-REI.2\n"},{"id":"CCSS.Math.Content.HSA.REI.B.3","name":"CCSS.Math.Content.HSA.REI.B.3","body":"Solve linear equations and inequalities in one variable, including equations with coefficients represented by letters.\n\nCluster: Solve equations and inequalities in one variable\nBig Ideas Algebra 1 Chapters: 1.1, 1.2, 1.3, 1.4, 2.2, 2.3, 2.4, 2.5, 2.6\nCodes: CCSS.Math.Content.HSA-REI.B.3, CCSS.Math.Content.HSA.REI.B.3, A-REI.3\n"},{"id":"CCSS.Math.Content.HSA.REI.B.4","name":"CCSS.Math.Content.HSA.REI.B.4","body":"Solve quadratic equations in one variable.\n\nCluster: Solve equations and inequalities in one variable\nCodes: CCSS.Math.Content.HSA-REI.B.4, CCSS.Math.Content.HSA.REI.B.4, A-REI.4\n"},{"id":"CCSS.Math.Content.HSA.REI.B.4a","name":"CCSS.Math.Content.HSA.REI.B.4a","body":"Use the method of completing the square to transform any quadratic equation in x into an equation of the form (x - p)2 = q that has the same solutions. Derive the quadratic formula from this form.\n\nCluster: Solve equations and inequalities in one variable\nBig Ideas Algebra 1 Chapters: 9.4, 9.5\nCodes: CCSS.Math.Content.HSA-REI.B.4a, CCSS.Math.Content.HSA.REI.B.4a, A-REI.4a\n"},{"id":"CCSS.Math.Content.HSA.REI.B.4b","name":"CCSS.Math.Content.HSA.REI.B.4b","body":"Solve quadratic equations by inspection (e.g., for x^2 = 49), taking square roots, completing the square, the quadratic formula and factoring, as appropriate to the initial form of the equation. Recognize when the quadratic formula gives complex solutions and write them as a  bi for real numbers a and b.\n\nCluster: Solve equations and inequalities in one variable\nBig Ideas Algebra 1 Chapters: 7.4, 9.3, 9.4, 9.5\nCodes: CCSS.Math.Content.HSA-REI.B.4b, CCSS.Math.Content.HSA.REI.B.4b, A-REI.4b\n"},{"id":"CCSS.Math.Content.HSA.REI.C.5","name":"CCSS.Math.Content.HSA.REI.C.5","body":"Prove that, given a system of two equations in two variables, replacing one equation by the sum of that equation and a multiple of the other produces a system with the same solutions.\n\nCluster: Solve systems of equations\nBig Ideas Algebra 1 Chapters: 5.3\nCodes: CCSS.Math.Content.HSA-REI.C.5, CCSS.Math.Content.HSA.REI.C.5, A-REI.5\n"},{"id":"CCSS.Math.Content.HSA.REI.C.6","name":"CCSS.Math.Content.HSA.REI.C.6","body":"Solve systems of linear equations exactly and approximately (e.g., with graphs), focusing on pairs of linear equations in two variables. \n\nCluster: Solve systems of equations\nBig Ideas Algebra 1 Chapters: 5.1, 5.2, 5.3, 5.4\nCodes: CCSS.Math.Content.HSA-REI.C.6, CCSS.Math.Content.HSA.REI.C.6, A-REI.6\n"},{"id":"CCSS.Math.Content.HSA.REI.C.7","name":"CCSS.Math.Content.HSA.REI.C.7","body":"Solve a simple system consisting of a linear equation and a quadratic equation in two variables algebraically and graphically. For example, find the points of intersection between the line y = -3x and the circle x^2 + y^2 = 3.\n\nCluster: Solve systems of equations\nBig Ideas Algebra 1 Chapters: 9.6\nCodes: CCSS.Math.Content.HSA-REI.C.7, CCSS.Math.Content.HSA.REI.C.7, A-REI.7\n"},{"id":"CCSS.Math.Content.HSA.REI.C.8","name":"CCSS.Math.Content.HSA.REI.C.8","body":"(+) Represent a system of linear equations as a single matrix equation in a vector variable.\n\nCluster: Solve systems of equations\nCodes: CCSS.Math.Content.HSA-REI.C.8, CCSS.Math.Content.HSA.REI.C.8, A-REI.8\n"},{"id":"CCSS.Math.Content.HSA.REI.C.9","name":"CCSS.Math.Content.HSA.REI.C.9","body":"(+) Find the inverse of a matrix if it exists and use it to solve systems of linear equations (using technology for matrices of dimension 3  3 or greater).\n\nCluster: Solve systems of equations\nCodes: CCSS.Math.Content.HSA-REI.C.9, CCSS.Math.Content.HSA.REI.C.9, A-REI.9\n"},{"id":"CCSS.Math.Content.HSA.REI.D.10","name":"CCSS.Math.Content.HSA.REI.D.10","body":"Understand that the graph of an equation in two variables is the set of all its solutions plotted in the coordinate plane, often forming a curve (which could be a line).\n\nCluster: Represent and solve equations and inequalities graphically\nBig Ideas Algebra 1 Chapters: 3.2, 3.7, 4.7\nCodes: CCSS.Math.Content.HSA-REI.D.10, CCSS.Math.Content.HSA.REI.D.10, A-REI.10\n"},{"id":"CCSS.Math.Content.HSA.REI.D.11","name":"CCSS.Math.Content.HSA.REI.D.11","body":"Explain why the x-coordinates of the points where the graphs of the equations y = f(x) and y = g(x) intersect are the solutions of the equation f(x) = g(x); find the solutions approximately, e.g., using technology to graph the functions, make tables of values, or find successive approximations. Include cases where f(x) and/or g(x) are linear, polynomial, rational, absolute value, exponential, and logarithmic functions.\n\nCluster: Represent and solve equations and inequalities graphically\nBig Ideas Algebra 1 Chapters: 5.5, 6.5, 9.2, 9.6\nCodes: CCSS.Math.Content.HSA-REI.D.11, CCSS.Math.Content.HSA.REI.D.11, A-REI.11\n"},{"id":"CCSS.Math.Content.HSA.REI.D.12","name":"CCSS.Math.Content.HSA.REI.D.12","body":"Graph the solutions to a linear inequality in two variables as a halfplane (excluding the boundary in the case of a strict inequality), and graph the solution set to a system of linear inequalities in two variables as the intersection of the corresponding half-planes. \n\nCluster: Represent and solve equations and inequalities graphically\nBig Ideas Algebra 1 Chapters: 5.6, 5.7\nCodes: CCSS.Math.Content.HSA-REI.D.12, CCSS.Math.Content.HSA.REI.D.12, A-REI.12\n"},{"id":"CCSS.Math.Content.HSA.REI","name":"CCSS.Math.Content.HSA.REI","body":"Other codes: CCSS.Math.Content.HSA-REI, CCSS.Math.Content.HSA.REI, A-REI\nwith Equations and Inequalities A -RE I"},{"id":"CCSS.Math.Content.HSA.SSE.A.1","name":"CCSS.Math.Content.HSA.SSE.A.1","body":"Interpret expressions that represent a quantity in terms of its context.\n\nCluster: Interpret the structure of expressions\nCodes: CCSS.Math.Content.HSA-SSE.A.1, CCSS.Math.Content.HSA.SSE.A.1, A-SSE.1\n"},{"id":"CCSS.Math.Content.HSA.SSE.A.1a","name":"CCSS.Math.Content.HSA.SSE.A.1a","body":"Interpret parts of an expression, such as terms, factors, and coefficients.\n\nCluster: Interpret the structure of expressions\nCodes: CCSS.Math.Content.HSA-SSE.A.1a, CCSS.Math.Content.HSA.SSE.A.1a, A-SSE.1a\n"},{"id":"CCSS.Math.Content.HSA.SSE.A.1b","name":"CCSS.Math.Content.HSA.SSE.A.1b","body":"Interpret complicated expressions by viewing one or more of their parts as a single entity. For example, interpret P(1+r)^n as the product of P and a factor not depending on P.\n\nCluster: Interpret the structure of expressions\nCodes: CCSS.Math.Content.HSA-SSE.A.1b, CCSS.Math.Content.HSA.SSE.A.1b, A-SSE.1b\n"},{"id":"CCSS.Math.Content.HSA.SSE.A.2","name":"CCSS.Math.Content.HSA.SSE.A.2","body":"Use the structure of an expression to identify ways to rewrite it. For example, see x^4 - y^4 as (x^2)^2 - (y^2)^2, thus recognizing it as a difference of squares that can be factored as (x^2 - y^2)(x^2 + y^2).\n\nCluster: Interpret the structure of expressions\nBig Ideas Algebra 1 Chapters: 7.5, 7.6, 7.7, 7.8\nCodes: CCSS.Math.Content.HSA-SSE.A.2, CCSS.Math.Content.HSA.SSE.A.2, A-SSE.2\n"},{"id":"CCSS.Math.Content.HSA.SSE.B.3","name":"CCSS.Math.Content.HSA.SSE.B.3","body":"Choose and produce an equivalent form of an expression to reveal and explain properties of the quantity represented by the expression.\n\nCluster: Write expressions in equivalent forms to solve problems\nCodes: CCSS.Math.Content.HSA-SSE.B.3, CCSS.Math.Content.HSA.SSE.B.3, A-SSE.3\n"},{"id":"CCSS.Math.Content.HSA.SSE.B.3a","name":"CCSS.Math.Content.HSA.SSE.B.3a","body":"Factor a quadratic expression to reveal the zeros of the function it defines.\n\nCluster: Write expressions in equivalent forms to solve problems\nBig Ideas Algebra 1 Chapters: 7.5, 7.6, 7.7, 7.8, 8.5\nCodes: CCSS.Math.Content.HSA-SSE.B.3a, CCSS.Math.Content.HSA.SSE.B.3a, A-SSE.3a\n"},{"id":"CCSS.Math.Content.HSA.SSE.B.3b","name":"CCSS.Math.Content.HSA.SSE.B.3b","body":"Complete the square in a quadratic expression to reveal the maximum or minimum value of the function it defines.\n\nCluster: Write expressions in equivalent forms to solve problems\nBig Ideas Algebra 1 Chapters: 9.4\nCodes: CCSS.Math.Content.HSA-SSE.B.3b, CCSS.Math.Content.HSA.SSE.B.3b, A-SSE.3b\n"},{"id":"CCSS.Math.Content.HSA.SSE.B.3c","name":"CCSS.Math.Content.HSA.SSE.B.3c","body":"Use the properties of exponents to transform expressions for exponential functions. For example the expression 1.15^t can be rewritten as (1.15^(1/12))^12t  1.01212^t to reveal the approximate equivalent monthly interest rate if the annual rate is 15%.\n\nCluster: Write expressions in equivalent forms to solve problems\nBig Ideas Algebra 1 Chapters: 6.4\nCodes: CCSS.Math.Content.HSA-SSE.B.3c, CCSS.Math.Content.HSA.SSE.B.3c, A-SSE.3c\n"},{"id":"CCSS.Math.Content.HSA.SSE.B.4","name":"CCSS.Math.Content.HSA.SSE.B.4","body":"Derive the formula for the sum of a finite geometric series (when the common ratio is not 1), and use the formula to solve problems. For example, calculate mortgage payments.\n\nCluster: Write expressions in equivalent forms to solve problems\nCodes: CCSS.Math.Content.HSA-SSE.B.4, CCSS.Math.Content.HSA.SSE.B.4, A-SSE.4\n"},{"id":"CCSS.Math.Content.HSA.SSE","name":"CCSS.Math.Content.HSA.SSE","body":"Other codes: CCSS.Math.Content.HSA-SSE, CCSS.Math.Content.HSA.SSE, A-SSE\nStructure in Expressions "},{"id":"CCSS.Math.Content.HSF.BF.A.1","name":"CCSS.Math.Content.HSF.BF.A.1","body":"Write a function that describes a relationship between two quantities.\n\nCluster: Build a function that models a relationship between two quantities\nCodes: CCSS.Math.Content.HSF-BF.A.1, CCSS.Math.Content.HSF.BF.A.1, F-BF.1\n"},{"id":"CCSS.Math.Content.HSF.BF.A.1a","name":"CCSS.Math.Content.HSF.BF.A.1a","body":"Determine an explicit expression, a recursive process, or steps for calculation from a context.\n\nCluster: Build a function that models a relationship between two quantities\nBig Ideas Algebra 1 Chapters: 4.1, 4.2, 4.6, 6.3, 6.4, 6.7, 8.4, 8.5, 8.6\nCodes: CCSS.Math.Content.HSF-BF.A.1a, CCSS.Math.Content.HSF.BF.A.1a, F-BF.1a\n"},{"id":"CCSS.Math.Content.HSF.BF.A.1b","name":"CCSS.Math.Content.HSF.BF.A.1b","body":"Combine standard function types using arithmetic operations. For example, build a function that models the temperature of a cooling body by adding a constant function to a decaying exponential, and relate these functions to the model.\n\nCluster: Build a function that models a relationship between two quantities\nCodes: CCSS.Math.Content.HSF-BF.A.1b, CCSS.Math.Content.HSF.BF.A.1b, F-BF.1b\n"},{"id":"CCSS.Math.Content.HSF.BF.A.1c","name":"CCSS.Math.Content.HSF.BF.A.1c","body":"(+) Compose functions. For example, if T(y) is the temperature in the atmosphere as a function of height, and h(t) is the height of a weather balloon as a function of time, then T(h(t)) is the temperature at the location of the weather balloon as a function of time.\n\nCluster: Build a function that models a relationship between two quantities\nCodes: CCSS.Math.Content.HSF-BF.A.1c, CCSS.Math.Content.HSF.BF.A.1c, F-BF.1c\n"},{"id":"CCSS.Math.Content.HSF.BF.A.2","name":"CCSS.Math.Content.HSF.BF.A.2","body":"Write arithmetic and geometric sequences both recursively and with an explicit formula, use them to model situations, and translate between the two forms.\n\nCluster: Build a function that models a relationship between two quantities\nBig Ideas Algebra 1 Chapters: 4.6, 6.6, 6.7\nCodes: CCSS.Math.Content.HSF-BF.A.2, CCSS.Math.Content.HSF.BF.A.2, F-BF.2\n"},{"id":"CCSS.Math.Content.HSF.BF.B.3","name":"CCSS.Math.Content.HSF.BF.B.3","body":"Identify the effect on the graph of replacing f(x) by f(x) + k, k f(x), f(kx), and f(x + k) for specific values of k (both positive and negative); find the value of k given the graphs. Experiment with cases and illustrate an explanation of the effects on the graph using technology. Include recognizing even and odd functions from their graphs and algebraic expressions for them.\n\nCluster: Build new functions from existing functions\nBig Ideas Algebra 1 Chapters: 3.6, 3.7, 6.3, 8.1, 8.2, 8.4\nCodes: CCSS.Math.Content.HSF-BF.B.3, CCSS.Math.Content.HSF.BF.B.3, F-BF.3\n"},{"id":"CCSS.Math.Content.HSF.BF.B.4","name":"CCSS.Math.Content.HSF.BF.B.4","body":"Find inverse functions.\n\nCluster: Build new functions from existing functions\nCodes: CCSS.Math.Content.HSF-BF.B.4, CCSS.Math.Content.HSF.BF.B.4, F-BF.4\n"},{"id":"CCSS.Math.Content.HSF.BF.B.4a","name":"CCSS.Math.Content.HSF.BF.B.4a","body":"Solve an equation of the form f(x) = c for a simple function f that has an inverse and write an expression for the inverse. For example, f(x) =2 x^3 or f(x) = (x+1)/(x-1) for x   1.\n\nCluster: Build new functions from existing functions\nBig Ideas Algebra 1 Chapters: 10.4\nCodes: CCSS.Math.Content.HSF-BF.B.4a, CCSS.Math.Content.HSF.BF.B.4a, F-BF.4a\n"},{"id":"CCSS.Math.Content.HSF.BF.B.4b","name":"CCSS.Math.Content.HSF.BF.B.4b","body":"(+) Verify by composition that one function is the inverse of another.\n\nCluster: Build new functions from existing functions\nCodes: CCSS.Math.Content.HSF-BF.B.4b, CCSS.Math.Content.HSF.BF.B.4b, F-BF.4b\n"},{"id":"CCSS.Math.Content.HSF.BF.B.4c","name":"CCSS.Math.Content.HSF.BF.B.4c","body":"(+) Read values of an inverse function from a graph or a table, given that the function has an inverse.\n\nCluster: Build new functions from existing functions\nCodes: CCSS.Math.Content.HSF-BF.B.4c, CCSS.Math.Content.HSF.BF.B.4c, F-BF.4c\n"},{"id":"CCSS.Math.Content.HSF.BF.B.4d","name":"CCSS.Math.Content.HSF.BF.B.4d","body":"(+) Produce an invertible function from a non-invertible function by restricting the domain.\n\nCluster: Build new functions from existing functions\nCodes: CCSS.Math.Content.HSF-BF.B.4d, CCSS.Math.Content.HSF.BF.B.4d, F-BF.4d\n"},{"id":"CCSS.Math.Content.HSF.BF.B.5","name":"CCSS.Math.Content.HSF.BF.B.5","body":"(+) Understand the inverse relationship between exponents and logarithms and use this relationship to solve problems involving logarithms and exponents.\n\nCluster: Build new functions from existing functions\nCodes: CCSS.Math.Content.HSF-BF.B.5, CCSS.Math.Content.HSF.BF.B.5, F-BF.5\n"},{"id":"CCSS.Math.Content.HSF.BF","name":"CCSS.Math.Content.HSF.BF","body":"Other codes: CCSS.Math.Content.HSF-BF, CCSS.Math.Content.HSF.BF, F-BF\nFunctions "},{"id":"CCSS.Math.Content.HSF.IF.A.1","name":"CCSS.Math.Content.HSF.IF.A.1","body":"Understand that a function from one set (called the domain) to another set (called the range) assigns to each element of the domain exactly one element of the range. If f is a function and x is an element of its domain, then f(x) denotes the output of f corresponding to the input x. The graph of f is the graph of the equation y = f(x).\n\nCluster: Understand the concept of a function and use function notation\nBig Ideas Algebra 1 Chapters: 3.1, 3.3\nCodes: CCSS.Math.Content.HSF-IF.A.1, CCSS.Math.Content.HSF.IF.A.1, F-IF.1\n"},{"id":"CCSS.Math.Content.HSF.IF.A.2","name":"CCSS.Math.Content.HSF.IF.A.2","body":"Use function notation, evaluate functions for inputs in their domains, and interpret statements that use function notation in terms of a context.\n\nCluster: Understand the concept of a function and use function notation\nBig Ideas Algebra 1 Chapters: 3.3\nCodes: CCSS.Math.Content.HSF-IF.A.2, CCSS.Math.Content.HSF.IF.A.2, F-IF.2\n"},{"id":"CCSS.Math.Content.HSF.IF.A.3","name":"CCSS.Math.Content.HSF.IF.A.3","body":"Recognize that sequences are functions, sometimes defined recursively, whose domain is a subset of the integers. For example, the Fibonacci sequence is defined recursively by f(0) = f(1) = 1, f(n+1) = f(n) + f(n-1) for n  1.\n\nCluster: Understand the concept of a function and use function notation\nBig Ideas Algebra 1 Chapters: 4.6, 6.6, 6.7\nCodes: CCSS.Math.Content.HSF-IF.A.3, CCSS.Math.Content.HSF.IF.A.3, F-IF.3\n"},{"id":"CCSS.Math.Content.HSF.IF.B.4","name":"CCSS.Math.Content.HSF.IF.B.4","body":"For a function that models a relationship between two quantities, interpret key features of graphs and tables in terms of the quantities, and sketch graphs showing key features given a verbal description of the relationship. Key features include: intercepts; intervals where the function is increasing, decreasing, positive, or negative; relative maximums and minimums; symmetries; end behavior; and periodicity.\n\nCluster: Interpret functions that arise in applications in terms of the context\nBig Ideas Algebra 1 Chapters: 3.5, 6.3, 8.4, 8.5, 10.1, 10.2\nCodes: CCSS.Math.Content.HSF-IF.B.4, CCSS.Math.Content.HSF.IF.B.4, F-IF.4\n"},{"id":"CCSS.Math.Content.HSF.IF.B.5","name":"CCSS.Math.Content.HSF.IF.B.5","body":"Relate the domain of a function to its graph and, where applicable, to the quantitative relationship it describes. For example, if the function h(n) gives the number of person-hours it takes to assemble n engines in a factory, then the positive integers would be an appropriate domain for the function.\n\nCluster: Interpret functions that arise in applications in terms of the context\nBig Ideas Algebra 1 Chapters: 3.2\nCodes: CCSS.Math.Content.HSF-IF.B.5, CCSS.Math.Content.HSF.IF.B.5, F-IF.5\n"},{"id":"CCSS.Math.Content.HSF.IF.B.6","name":"CCSS.Math.Content.HSF.IF.B.6","body":"Calculate and interpret the average rate of change of a function (presented symbolically or as a table) over a specified interval. Estimate the rate of change from a graph.\n\nCluster: Interpret functions that arise in applications in terms of the context\nBig Ideas Algebra 1 Chapters: 8.6, 10.1, 10.2\nCodes: CCSS.Math.Content.HSF-IF.B.6, CCSS.Math.Content.HSF.IF.B.6, F-IF.6\n"},{"id":"CCSS.Math.Content.HSF.IF.C.7","name":"CCSS.Math.Content.HSF.IF.C.7","body":"Graph functions expressed symbolically and show key features of the graph, by hand in simple cases and using technology for more complicated cases.\n\nCluster: Analyze functions using different representations\nCodes: CCSS.Math.Content.HSF-IF.C.7, CCSS.Math.Content.HSF.IF.C.7, F-IF.7\n"},{"id":"CCSS.Math.Content.HSF.IF.C.7a","name":"CCSS.Math.Content.HSF.IF.C.7a","body":"Graph linear and quadratic functions and show intercepts, maxima, and minima.\n\nCluster: Analyze functions using different representations\nBig Ideas Algebra 1 Chapters: 3.2, 3.4, 3.5, 3.6, 8.1, 8.2, 8.3, 9.2\nCodes: CCSS.Math.Content.HSF-IF.C.7a, CCSS.Math.Content.HSF.IF.C.7a, F-IF.7a\n"},{"id":"CCSS.Math.Content.HSF.IF.C.7b","name":"CCSS.Math.Content.HSF.IF.C.7b","body":"Graph square root, cube root, and piecewise-defined functions, including step functions and absolute value functions.\n\nCluster: Analyze functions using different representations\nBig Ideas Algebra 1 Chapters: 3.7, 4.7, 10.1, 10.2\nCodes: CCSS.Math.Content.HSF-IF.C.7b, CCSS.Math.Content.HSF.IF.C.7b, F-IF.7b\n"},{"id":"CCSS.Math.Content.HSF.IF.C.7c","name":"CCSS.Math.Content.HSF.IF.C.7c","body":"Graph polynomial functions, identifying zeros when suitable factorizations are available, and showing end behavior.\n\nCluster: Analyze functions using different representations\nBig Ideas Algebra 1 Chapters: 3.3\nCodes: CCSS.Math.Content.HSF-IF.C.7c, CCSS.Math.Content.HSF.IF.C.7c, F-IF.7c\n"},{"id":"CCSS.Math.Content.HSF.IF.C.7d","name":"CCSS.Math.Content.HSF.IF.C.7d","body":"(+) Graph rational functions, identifying zeros and asymptotes when suitable factorizations are available, and showing end behavior. \n\nCluster: Analyze functions using different representations\nCodes: CCSS.Math.Content.HSF-IF.C.7d, CCSS.Math.Content.HSF.IF.C.7d, F-IF.7d\n"},{"id":"CCSS.Math.Content.HSF.IF.C.7e","name":"CCSS.Math.Content.HSF.IF.C.7e","body":"Graph exponential and logarithmic functions, showing intercepts and end behavior, and trigonometric functions, showing period, midline, and amplitude.\n\nCluster: Analyze functions using different representations\nBig Ideas Algebra 1 Chapters: 6.3, 6.4\nCodes: CCSS.Math.Content.HSF-IF.C.7e, CCSS.Math.Content.HSF.IF.C.7e, F-IF.7e\n"},{"id":"CCSS.Math.Content.HSF.IF.C.8","name":"CCSS.Math.Content.HSF.IF.C.8","body":"Write a function defined by an expression in different but equivalent forms to reveal and explain different properties of the function. \n\nCluster: Analyze functions using different representations\nCodes: CCSS.Math.Content.HSF-IF.C.8, CCSS.Math.Content.HSF.IF.C.8, F-IF.8\n"},{"id":"CCSS.Math.Content.HSF.IF.C.8a","name":"CCSS.Math.Content.HSF.IF.C.8a","body":"Use the process of factoring and completing the square in a quadratic function to show zeros, extreme values, and symmetry of the graph, and interpret these in terms of a context.\n\nCluster: Analyze functions using different representations\nBig Ideas Algebra 1 Chapters: 8.5, 9.4\nCodes: CCSS.Math.Content.HSF-IF.C.8a, CCSS.Math.Content.HSF.IF.C.8a, F-IF.8a\n"},{"id":"CCSS.Math.Content.HSF.IF.C.8b","name":"CCSS.Math.Content.HSF.IF.C.8b","body":"Use the properties of exponents to interpret expressions for exponential functions. For example, identify percent rate of change in functions such as y = (1.02)t, y = (0.97)t, y = (1.01)12t, y = (1.2)t/10, and classify them as representing exponential growth or decay.\n\nCluster: Analyze functions using different representations\nBig Ideas Algebra 1 Chapters: 6.4\nCodes: CCSS.Math.Content.HSF-IF.C.8b, CCSS.Math.Content.HSF.IF.C.8b, F-IF.8b\n"},{"id":"CCSS.Math.Content.HSF.IF.C.9","name":"CCSS.Math.Content.HSF.IF.C.9","body":"Compare properties of two functions each represented in a different way (algebraically, graphically, numerically in tables, or by verbal descriptions). For example, given a graph of one quadratic function and an algebraic expression for another, say which has the larger maximum.\n\nCluster: Analyze functions using different representations\nBig Ideas Algebra 1 Chapters: 6.3, 8.3, 10.1, 10.2\nCodes: CCSS.Math.Content.HSF-IF.C.9, CCSS.Math.Content.HSF.IF.C.9, F-IF.9\n"},{"id":"CCSS.Math.Content.HSF.IF","name":"CCSS.Math.Content.HSF.IF","body":"Other codes: CCSS.Math.Content.HSF-IF, CCSS.Math.Content.HSF.IF, F-IF\nFunctions"},{"id":"CCSS.Math.Content.HSF.LE.A.1","name":"CCSS.Math.Content.HSF.LE.A.1","body":"Distinguish between situations that can be modeled with linear functions and with exponential functions.\n\nCluster: Construct and compare linear, quadratic, and exponential models and solve problems\nCodes: CCSS.Math.Content.HSF-LE.A.1, CCSS.Math.Content.HSF.LE.A.1, F-LE.1\n"},{"id":"CCSS.Math.Content.HSF.LE.A.1a","name":"CCSS.Math.Content.HSF.LE.A.1a","body":"Prove that linear functions grow by equal differences over equal intervals, and that exponential functions grow by equal factors over equal intervals.\n\nCluster: Construct and compare linear, quadratic, and exponential models and solve problems\nBig Ideas Algebra 1 Chapters: 6.3\nCodes: CCSS.Math.Content.HSF-LE.A.1a, CCSS.Math.Content.HSF.LE.A.1a, F-LE.1a\n"},{"id":"CCSS.Math.Content.HSF.LE.A.1b","name":"CCSS.Math.Content.HSF.LE.A.1b","body":"Recognize situations in which one quantity changes at a constant rate per unit interval relative to another.\n\nCluster: Construct and compare linear, quadratic, and exponential models and solve problems\nBig Ideas Algebra 1 Chapters: 3.2, 4.1, 4.2\nCodes: CCSS.Math.Content.HSF-LE.A.1b, CCSS.Math.Content.HSF.LE.A.1b, F-LE.1b\n"},{"id":"CCSS.Math.Content.HSF.LE.A.1c","name":"CCSS.Math.Content.HSF.LE.A.1c","body":"Recognize situations in which a quantity grows or decays by a constant percent rate per unit interval relative to another.\n\nCluster: Construct and compare linear, quadratic, and exponential models and solve problems\nBig Ideas Algebra 1 Chapters: 6.4\nCodes: CCSS.Math.Content.HSF-LE.A.1c, CCSS.Math.Content.HSF.LE.A.1c, F-LE.1c\n"},{"id":"CCSS.Math.Content.HSF.LE.A.2","name":"CCSS.Math.Content.HSF.LE.A.2","body":"Construct linear and exponential functions, including arithmetic and geometric sequences, given a graph, a description of a relationship, or two input-output pairs (include reading these from a table).\n\nCluster: Construct and compare linear, quadratic, and exponential models and solve problems\nBig Ideas Algebra 1 Chapters: 4.1, 4.2, 4.3, 4.6, 6.3, 6.4, 6.6, 6.7\nCodes: CCSS.Math.Content.HSF-LE.A.2, CCSS.Math.Content.HSF.LE.A.2, F-LE.2\n"},{"id":"CCSS.Math.Content.HSF.LE.A.3","name":"CCSS.Math.Content.HSF.LE.A.3","body":"Observe using graphs and tables that a quantity increasing exponentially eventually exceeds a quantity increasing linearly, quadratically, or (more generally) as a polynomial function.\n\nCluster: Construct and compare linear, quadratic, and exponential models and solve problems\nBig Ideas Algebra 1 Chapters: 8.6\nCodes: CCSS.Math.Content.HSF-LE.A.3, CCSS.Math.Content.HSF.LE.A.3, F-LE.3\n"},{"id":"CCSS.Math.Content.HSF.LE.A.4","name":"CCSS.Math.Content.HSF.LE.A.4","body":"For exponential models, express as a logarithm the solution to abct = d where a, c, and d are numbers and the base b is 2,10, or e; evaluate the logarithm using technology.\n\nCluster: Construct and compare linear, quadratic, and exponential models and solve problems\nCodes: CCSS.Math.Content.HSF-LE.A.4, CCSS.Math.Content.HSF.LE.A.4, F-LE.4\n"},{"id":"CCSS.Math.Content.HSF.LE.B.5","name":"CCSS.Math.Content.HSF.LE.B.5","body":"Interpret the parameters in a linear or exponential function in terms of a context.\n\nCluster: Interpret expressions for functions in terms of the situation they model\nBig Ideas Algebra 1 Chapters: 3.5, 4.4, 4.5\nCodes: CCSS.Math.Content.HSF-LE.B.5, CCSS.Math.Content.HSF.LE.B.5, F-LE.5\n"},{"id":"CCSS.Math.Content.HSF.LE","name":"CCSS.Math.Content.HSF.LE","body":"Other codes: CCSS.Math.Content.HSF-LE, CCSS.Math.Content.HSF.LE, F-LE\nQuadratic, and Exponential Models "},{"id":"CCSS.Math.Content.HSF.TF.A.1","name":"CCSS.Math.Content.HSF.TF.A.1","body":"Understand radian measure of an angle as the length of the arc on the unit circle subtended by the angle.\n\nCluster: Extend the domain of trigonometric functions using the unit circle\nCodes: CCSS.Math.Content.HSF-TF.A.1, CCSS.Math.Content.HSF.TF.A.1, F-TF.1\n"},{"id":"CCSS.Math.Content.HSF.TF.A.2","name":"CCSS.Math.Content.HSF.TF.A.2","body":"Explain how the unit circle in the coordinate plane enables the extension of trigonometric functions to all real numbers, interpreted as radian measures of angles traversed counterclockwise around the unit circle.\n\nCluster: Extend the domain of trigonometric functions using the unit circle\nCodes: CCSS.Math.Content.HSF-TF.A.2, CCSS.Math.Content.HSF.TF.A.2, F-TF.2\n"},{"id":"CCSS.Math.Content.HSF.TF.A.3","name":"CCSS.Math.Content.HSF.TF.A.3","body":"(+) Use special triangles to determine geometrically the values of sine, cosine, tangent for /3, /4 and /6, and use the unit circle to express the values of sine, cosine, and tangent for -x, +x, and 2-x in terms of their values for x, where x is any real number.\n\nCluster: Extend the domain of trigonometric functions using the unit circle\nCodes: CCSS.Math.Content.HSF-TF.A.3, CCSS.Math.Content.HSF.TF.A.3, F-TF.3\n"},{"id":"CCSS.Math.Content.HSF.TF.A.4","name":"CCSS.Math.Content.HSF.TF.A.4","body":"(+) Use the unit circle to explain symmetry (odd and even) and periodicity of trigonometric functions.\n\nCluster: Extend the domain of trigonometric functions using the unit circle\nCodes: CCSS.Math.Content.HSF-TF.A.4, CCSS.Math.Content.HSF.TF.A.4, F-TF.4\n"},{"id":"CCSS.Math.Content.HSF.TF.B.5","name":"CCSS.Math.Content.HSF.TF.B.5","body":"Choose trigonometric functions to model periodic phenomena with specified amplitude, frequency, and midline.\n\nCluster: Model periodic phenomena with trigonometric functions\nCodes: CCSS.Math.Content.HSF-TF.B.5, CCSS.Math.Content.HSF.TF.B.5, F-TF.5\n"},{"id":"CCSS.Math.Content.HSF.TF.B.6","name":"CCSS.Math.Content.HSF.TF.B.6","body":"(+) Understand that restricting a trigonometric function to a domain on which it is always increasing or always decreasing allows its inverse to be constructed.\n\nCluster: Model periodic phenomena with trigonometric functions\nCodes: CCSS.Math.Content.HSF-TF.B.6, CCSS.Math.Content.HSF.TF.B.6, F-TF.6\n"},{"id":"CCSS.Math.Content.HSF.TF.B.7","name":"CCSS.Math.Content.HSF.TF.B.7","body":"(+) Use inverse functions to solve trigonometric equations that arise in modeling contexts; evaluate the solutions using technology, and interpret them in terms of the context.\n\nCluster: Model periodic phenomena with trigonometric functions\nCodes: CCSS.Math.Content.HSF-TF.B.7, CCSS.Math.Content.HSF.TF.B.7, F-TF.7\n"},{"id":"CCSS.Math.Content.HSF.TF.C.8","name":"CCSS.Math.Content.HSF.TF.C.8","body":"Prove the Pythagorean identity sin^2() + cos^2() = 1 and use it to find sin(), cos(), or tan() given sin(), cos(), or tan() and the quadrant of the angle.\n\nCluster: Prove and apply trigonometric identities\nCodes: CCSS.Math.Content.HSF-TF.C.8, CCSS.Math.Content.HSF.TF.C.8, F-TF.8\n"},{"id":"CCSS.Math.Content.HSF.TF.C.9","name":"CCSS.Math.Content.HSF.TF.C.9","body":"(+) Prove the addition and subtraction formulas for sine, cosine, and tangent and use them to solve problems.\n\nCluster: Prove and apply trigonometric identities\nCodes: CCSS.Math.Content.HSF-TF.C.9, CCSS.Math.Content.HSF.TF.C.9, F-TF.9\n"},{"id":"CCSS.Math.Content.HSF.TF","name":"CCSS.Math.Content.HSF.TF","body":"Other codes: CCSS.Math.Content.HSF-TF, CCSS.Math.Content.HSF.TF, F-TF\nFunctions "},{"id":"CCSS.Math.Content.HSG.C.A.1","name":"CCSS.Math.Content.HSG.C.A.1","body":"Prove that all circles are similar. \n\nCluster: Understand and apply theorems about circles\nCodes: CCSS.Math.Content.HSG-C.A.1, CCSS.Math.Content.HSG.C.A.1, G-C.1\n"},{"id":"CCSS.Math.Content.HSG.C.A.2","name":"CCSS.Math.Content.HSG.C.A.2","body":"Identify and describe relationships among inscribed angles, radii, and chords. Include the relationship between central, inscribed, and circumscribed angles; inscribed angles on a diameter are right angles; the radius of a circle is perpendicular to the tangent where the radius intersects the circle.\n\nCluster: Understand and apply theorems about circles\nCodes: CCSS.Math.Content.HSG-C.A.2, CCSS.Math.Content.HSG.C.A.2, G-C.2\n"},{"id":"CCSS.Math.Content.HSG.C.A.3","name":"CCSS.Math.Content.HSG.C.A.3","body":"Construct the inscribed and circumscribed circles of a triangle, and prove properties of angles for a quadrilateral inscribed in a circle.\n\nCluster: Understand and apply theorems about circles\nCodes: CCSS.Math.Content.HSG-C.A.3, CCSS.Math.Content.HSG.C.A.3, G-C.3\n"},{"id":"CCSS.Math.Content.HSG.C.A.4","name":"CCSS.Math.Content.HSG.C.A.4","body":"(+) Construct a tangent line from a point outside a given circle to the circle.\n\nCluster: Understand and apply theorems about circles\nCodes: CCSS.Math.Content.HSG-C.A.4, CCSS.Math.Content.HSG.C.A.4, G-C.4\n"},{"id":"CCSS.Math.Content.HSG.C.B.5","name":"CCSS.Math.Content.HSG.C.B.5","body":"Derive using similarity the fact that the length of the arc intercepted by an angle is proportional to the radius, and define the radian measure of the angle as the constant of proportionality; derive the formula for the area of a sector.\n\nCluster: Find the lengths and areas of sectors of circles\nCodes: CCSS.Math.Content.HSG-C.B.5, CCSS.Math.Content.HSG.C.B.5, G-C.5\n"},{"id":"CCSS.Math.Content.HSG.C","name":"CCSS.Math.Content.HSG.C","body":"Other codes: CCSS.Math.Content.HSG-C, CCSS.Math.Content.HSG.C, G-C\n"},{"id":"CCSS.Math.Content.HSG.CO.A.1","name":"CCSS.Math.Content.HSG.CO.A.1","body":"Know precise definitions of angle, circle, perpendicular line, parallel line, and line segment, based on the undefined notions of point, line, distance along a line, and distance around a circular arc.\n\nCluster: Experiment with transformations in the plane\nCodes: CCSS.Math.Content.HSG-CO.A.1, CCSS.Math.Content.HSG.CO.A.1, G-CO.1\n"},{"id":"CCSS.Math.Content.HSG.CO.A.2","name":"CCSS.Math.Content.HSG.CO.A.2","body":"Represent transformations in the plane using, e.g., transparencies and geometry software; describe transformations as functions that take points in the plane as inputs and give other points as outputs. Compare transformations that preserve distance and angle to those that do not (e.g., translation versus horizontal stretch).\n\nCluster: Experiment with transformations in the plane\nCodes: CCSS.Math.Content.HSG-CO.A.2, CCSS.Math.Content.HSG.CO.A.2, G-CO.2\n"},{"id":"CCSS.Math.Content.HSG.CO.A.3","name":"CCSS.Math.Content.HSG.CO.A.3","body":"Given a rectangle, parallelogram, trapezoid, or regular polygon, describe the rotations and reflections that carry it onto itself.\n\nCluster: Experiment with transformations in the plane\nCodes: CCSS.Math.Content.HSG-CO.A.3, CCSS.Math.Content.HSG.CO.A.3, G-CO.3\n"},{"id":"CCSS.Math.Content.HSG.CO.A.4","name":"CCSS.Math.Content.HSG.CO.A.4","body":"Develop definitions of rotations, reflections, and translations in terms of angles, circles, perpendicular lines, parallel lines, and line segments. \n\nCluster: Experiment with transformations in the plane\nCodes: CCSS.Math.Content.HSG-CO.A.4, CCSS.Math.Content.HSG.CO.A.4, G-CO.4\n"},{"id":"CCSS.Math.Content.HSG.CO.A.5","name":"CCSS.Math.Content.HSG.CO.A.5","body":"Given a geometric figure and a rotation, reflection, or translation, draw the transformed figure using, e.g., graph paper, tracing paper, or geometry software. Specify a sequence of transformations that will carry a given figure onto another.\n\nCluster: Experiment with transformations in the plane\nCodes: CCSS.Math.Content.HSG-CO.A.5, CCSS.Math.Content.HSG.CO.A.5, G-CO.5\n"},{"id":"CCSS.Math.Content.HSG.CO.B.6","name":"CCSS.Math.Content.HSG.CO.B.6","body":"Use geometric descriptions of rigid motions to transform figures and to predict the effect of a given rigid motion on a given figure; given two figures, use the definition of congruence in terms of rigid motions to decide if they are congruent.\n\nCluster: Understand congruence in terms of rigid motions\nCodes: CCSS.Math.Content.HSG-CO.B.6, CCSS.Math.Content.HSG.CO.B.6, G-CO.6\n"},{"id":"CCSS.Math.Content.HSG.CO.B.7","name":"CCSS.Math.Content.HSG.CO.B.7","body":"Use the definition of congruence in terms of rigid motions to show that two triangles are congruent if and only if corresponding pairs of sides and corresponding pairs of angles are congruent.\n\nCluster: Understand congruence in terms of rigid motions\nCodes: CCSS.Math.Content.HSG-CO.B.7, CCSS.Math.Content.HSG.CO.B.7, G-CO.7\n"},{"id":"CCSS.Math.Content.HSG.CO.B.8","name":"CCSS.Math.Content.HSG.CO.B.8","body":"Explain how the criteria for triangle congruence (ASA, SAS, and SSS) follow from the definition of congruence in terms of rigid motions. \n\nCluster: Understand congruence in terms of rigid motions\nCodes: CCSS.Math.Content.HSG-CO.B.8, CCSS.Math.Content.HSG.CO.B.8, G-CO.8\n"},{"id":"CCSS.Math.Content.HSG.CO.C.10","name":"CCSS.Math.Content.HSG.CO.C.10","body":"Prove theorems about triangles. Theorems include: measures of interior angles of a triangle sum to 180; base angles of isosceles triangles are congruent; the segment joining midpoints of two sides of a triangle is parallel to the third side and half the length; the medians of a triangle meet at a point.\n\nCluster: Prove geometric theorems\nCodes: CCSS.Math.Content.HSG-CO.C.10, CCSS.Math.Content.HSG.CO.C.10, G-CO.10\n"},{"id":"CCSS.Math.Content.HSG.CO.C.11","name":"CCSS.Math.Content.HSG.CO.C.11","body":"Prove theorems about parallelograms. Theorems include: opposite sides are congruent, opposite angles are congruent, the diagonals of a parallelogram bisect each other, and conversely, rectangles are parallelograms with congruent diagonals.\n\nCluster: Prove geometric theorems\nCodes: CCSS.Math.Content.HSG-CO.C.11, CCSS.Math.Content.HSG.CO.C.11, G-CO.11\n"},{"id":"CCSS.Math.Content.HSG.CO.C.9","name":"CCSS.Math.Content.HSG.CO.C.9","body":"Prove theorems about lines and angles. Theorems include: vertical angles are congruent; when a transversal crosses parallel lines, alternate interior angles are congruent and corresponding angles are congruent; points on a perpendicular bisector of a line segment are exactly those equidistant from the segment's endpoints.\n\nCluster: Prove geometric theorems\nCodes: CCSS.Math.Content.HSG-CO.C.9, CCSS.Math.Content.HSG.CO.C.9, G-CO.9\n"},{"id":"CCSS.Math.Content.HSG.CO.D.12","name":"CCSS.Math.Content.HSG.CO.D.12","body":"Make formal geometric constructions with a variety of tools and methods (compass and straightedge, string, reflective devices, paper folding, dynamic geometric software, etc.). Copying a segment; copying an angle; bisecting a segment; bisecting an angle; constructing perpendicular lines, including the perpendicular bisector of a line segment; and constructing a line parallel to a given line through a point not on the line.\n\nCluster: Make geometric constructions\nCodes: CCSS.Math.Content.HSG-CO.D.12, CCSS.Math.Content.HSG.CO.D.12, G-CO.12\n"},{"id":"CCSS.Math.Content.HSG.CO.D.13","name":"CCSS.Math.Content.HSG.CO.D.13","body":"Construct an equilateral triangle, a square, and a regular hexagon inscribed in a circle.\n\nCluster: Make geometric constructions\nCodes: CCSS.Math.Content.HSG-CO.D.13, CCSS.Math.Content.HSG.CO.D.13, G-CO.13\n"},{"id":"CCSS.Math.Content.HSG.CO","name":"CCSS.Math.Content.HSG.CO","body":"Other codes: CCSS.Math.Content.HSG-CO, CCSS.Math.Content.HSG.CO, G-CO\n"},{"id":"CCSS.Math.Content.HSG.GMD.A.1","name":"CCSS.Math.Content.HSG.GMD.A.1","body":"Give an informal argument for the formulas for the circumference of a circle, area of a circle, volume of a cylinder, pyramid, and cone. Use dissection arguments, Cavalieri's principle, and informal limit arguments.\n\nCluster: Explain volume formulas and use them to solve problems\nCodes: CCSS.Math.Content.HSG-GMD.A.1, CCSS.Math.Content.HSG.GMD.A.1, G-GMD.1\n"},{"id":"CCSS.Math.Content.HSG.GMD.A.2","name":"CCSS.Math.Content.HSG.GMD.A.2","body":"(+) Give an informal argument using Cavalieri's principle for the formulas for the volume of a sphere and other solid figures.\n\nCluster: Explain volume formulas and use them to solve problems\nCodes: CCSS.Math.Content.HSG-GMD.A.2, CCSS.Math.Content.HSG.GMD.A.2, G-GMD.2\n"},{"id":"CCSS.Math.Content.HSG.GMD.A.3","name":"CCSS.Math.Content.HSG.GMD.A.3","body":"Use volume formulas for cylinders, pyramids, cones, and spheres to solve problems.\n\nCluster: Explain volume formulas and use them to solve problems\nCodes: CCSS.Math.Content.HSG-GMD.A.3, CCSS.Math.Content.HSG.GMD.A.3, G-GMD.3\n"},{"id":"CCSS.Math.Content.HSG.GMD.B.4","name":"CCSS.Math.Content.HSG.GMD.B.4","body":"Identify the shapes of two-dimensional cross-sections of three dimensional objects, and identify three-dimensional objects generated by rotations of two-dimensional objects. \n\nCluster: Visualize relationships between two-dimensional and three-dimensional objects\nCodes: CCSS.Math.Content.HSG-GMD.B.4, CCSS.Math.Content.HSG.GMD.B.4, G-GMD.4\n"},{"id":"CCSS.Math.Content.HSG.GMD","name":"CCSS.Math.Content.HSG.GMD","body":"Other codes: CCSS.Math.Content.HSG-GMD, CCSS.Math.Content.HSG.GMD, G-GMD\nMeasurement and Dimension "},{"id":"CCSS.Math.Content.HSG.GPE.A.1","name":"CCSS.Math.Content.HSG.GPE.A.1","body":"Derive the equation of a circle of given center and radius using the Pythagorean Theorem; complete the square to find the center and radius of a circle given by an equation.\n\nCluster: Translate between the geometric description and the equation for a conic section\nCodes: CCSS.Math.Content.HSG-GPE.A.1, CCSS.Math.Content.HSG.GPE.A.1, G-GPE.1\n"},{"id":"CCSS.Math.Content.HSG.GPE.A.2","name":"CCSS.Math.Content.HSG.GPE.A.2","body":"Derive the equation of a parabola given a focus and directrix.\n\nCluster: Translate between the geometric description and the equation for a conic section\nCodes: CCSS.Math.Content.HSG-GPE.A.2, CCSS.Math.Content.HSG.GPE.A.2, G-GPE.2\n"},{"id":"CCSS.Math.Content.HSG.GPE.A.3","name":"CCSS.Math.Content.HSG.GPE.A.3","body":"(+) Derive the equations of ellipses and hyperbolas given the foci, using the fact that the sum or difference of distances from the foci is constant.\n\nCluster: Translate between the geometric description and the equation for a conic section\nCodes: CCSS.Math.Content.HSG-GPE.A.3, CCSS.Math.Content.HSG.GPE.A.3, G-GPE.3\n"},{"id":"CCSS.Math.Content.HSG.GPE.B.4","name":"CCSS.Math.Content.HSG.GPE.B.4","body":"Use coordinates to prove simple geometric theorems algebraically. For example, prove or disprove that a figure defined by four given points in the coordinate plane is a rectangle; prove or disprove that the point (1, 3) lies on the circle centered at the origin and containing the point (0, 2).\n\nCluster: Use coordinates to prove simple geometric theorems algebraically\nCodes: CCSS.Math.Content.HSG-GPE.B.4, CCSS.Math.Content.HSG.GPE.B.4, G-GPE.4\n"},{"id":"CCSS.Math.Content.HSG.GPE.B.5","name":"CCSS.Math.Content.HSG.GPE.B.5","body":"Prove the slope criteria for parallel and perpendicular lines and use them to solve geometric problems (e.g., find the equation of a line parallel or perpendicular to a given line that passes through a given point).\n\nCluster: Use coordinates to prove simple geometric theorems algebraically\nCodes: CCSS.Math.Content.HSG-GPE.B.5, CCSS.Math.Content.HSG.GPE.B.5, G-GPE.5\n"},{"id":"CCSS.Math.Content.HSG.GPE.B.6","name":"CCSS.Math.Content.HSG.GPE.B.6","body":"Find the point on a directed line segment between two given points that partitions the segment in a given ratio.\n\nCluster: Use coordinates to prove simple geometric theorems algebraically\nCodes: CCSS.Math.Content.HSG-GPE.B.6, CCSS.Math.Content.HSG.GPE.B.6, G-GPE.6\n"},{"id":"CCSS.Math.Content.HSG.GPE.B.7","name":"CCSS.Math.Content.HSG.GPE.B.7","body":"Use coordinates to compute perimeters of polygons and areas of triangles and rectangles, e.g., using the distance formula.\n\nCluster: Use coordinates to prove simple geometric theorems algebraically\nCodes: CCSS.Math.Content.HSG-GPE.B.7, CCSS.Math.Content.HSG.GPE.B.7, G-GPE.7\n"},{"id":"CCSS.Math.Content.HSG.GPE","name":"CCSS.Math.Content.HSG.GPE","body":"Other codes: CCSS.Math.Content.HSG-GPE, CCSS.Math.Content.HSG.GPE, G-GPE\nGeometric Properties with Equations "},{"id":"CCSS.Math.Content.HSG.MG.A.1","name":"CCSS.Math.Content.HSG.MG.A.1","body":"Use geometric shapes, their measures, and their properties to describe objects (e.g., modeling a tree trunk or a human torso as a cylinder).\n\nCluster: Apply geometric concepts in modeling situations\nCodes: CCSS.Math.Content.HSG-MG.A.1, CCSS.Math.Content.HSG.MG.A.1, G-MG.1\n"},{"id":"CCSS.Math.Content.HSG.MG.A.2","name":"CCSS.Math.Content.HSG.MG.A.2","body":"Apply concepts of density based on area and volume in modeling situations (e.g., persons per square mile, BTUs per cubic foot).\n\nCluster: Apply geometric concepts in modeling situations\nCodes: CCSS.Math.Content.HSG-MG.A.2, CCSS.Math.Content.HSG.MG.A.2, G-MG.2\n"},{"id":"CCSS.Math.Content.HSG.MG.A.3","name":"CCSS.Math.Content.HSG.MG.A.3","body":"Apply geometric methods to solve design problems (e.g., designing an object or structure to satisfy physical constraints or minimize cost; working with typographic grid systems based on ratios).\n\nCluster: Apply geometric concepts in modeling situations\nCodes: CCSS.Math.Content.HSG-MG.A.3, CCSS.Math.Content.HSG.MG.A.3, G-MG.3\n"},{"id":"CCSS.Math.Content.HSG.MG","name":"CCSS.Math.Content.HSG.MG","body":"Other codes: CCSS.Math.Content.HSG-MG, CCSS.Math.Content.HSG.MG, G-MG\nwith Geometry "},{"id":"CCSS.Math.Content.HSG.SRT.A.1","name":"CCSS.Math.Content.HSG.SRT.A.1","body":"Verify experimentally the properties of dilations given by a center and a scale factor:\n\nCluster: Understand similarity in terms of similarity transformations\nCodes: CCSS.Math.Content.HSG-SRT.A.1, CCSS.Math.Content.HSG.SRT.A.1, G-SRT.1\n"},{"id":"CCSS.Math.Content.HSG.SRT.A.1a","name":"CCSS.Math.Content.HSG.SRT.A.1a","body":"A dilation takes a line not passing through the center of the dilation to a parallel line, and leaves a line passing through the center unchanged.\n\nCluster: Understand similarity in terms of similarity transformations\nCodes: CCSS.Math.Content.HSG-SRT.A.1a, CCSS.Math.Content.HSG.SRT.A.1a, G-SRT.1a\n"},{"id":"CCSS.Math.Content.HSG.SRT.A.1b","name":"CCSS.Math.Content.HSG.SRT.A.1b","body":"The dilation of a line segment is longer or shorter in the ratio given by the scale factor.\n\nCluster: Understand similarity in terms of similarity transformations\nCodes: CCSS.Math.Content.HSG-SRT.A.1b, CCSS.Math.Content.HSG.SRT.A.1b, G-SRT.1b\n"},{"id":"CCSS.Math.Content.HSG.SRT.A.2","name":"CCSS.Math.Content.HSG.SRT.A.2","body":"Given two figures, use the definition of similarity in terms of similarity transformations to decide if they are similar; explain using similarity transformations the meaning of similarity for triangles as the equality of all corresponding pairs of angles and the proportionality of all corresponding pairs of sides.\n\nCluster: Understand similarity in terms of similarity transformations\nCodes: CCSS.Math.Content.HSG-SRT.A.2, CCSS.Math.Content.HSG.SRT.A.2, G-SRT.2\n"},{"id":"CCSS.Math.Content.HSG.SRT.A.3","name":"CCSS.Math.Content.HSG.SRT.A.3","body":"Use the properties of similarity transformations to establish the AA criterion for two triangles to be similar.\n\nCluster: Understand similarity in terms of similarity transformations\nCodes: CCSS.Math.Content.HSG-SRT.A.3, CCSS.Math.Content.HSG.SRT.A.3, G-SRT.3\n"},{"id":"CCSS.Math.Content.HSG.SRT.B.4","name":"CCSS.Math.Content.HSG.SRT.B.4","body":"Prove theorems about triangles. Theorems include: a line parallel to one side of a triangle divides the other two proportionally, and conversely; the Pythagorean Theorem proved using triangle similarity. \n\nCluster: Prove theorems involving similarity\nCodes: CCSS.Math.Content.HSG-SRT.B.4, CCSS.Math.Content.HSG.SRT.B.4, G-SRT.4\n"},{"id":"CCSS.Math.Content.HSG.SRT.B.5","name":"CCSS.Math.Content.HSG.SRT.B.5","body":"Use congruence and similarity criteria for triangles to solve problems and to prove relationships in geometric figures.\n\nCluster: Prove theorems involving similarity\nCodes: CCSS.Math.Content.HSG-SRT.B.5, CCSS.Math.Content.HSG.SRT.B.5, G-SRT.5\n"},{"id":"CCSS.Math.Content.HSG.SRT.C.6","name":"CCSS.Math.Content.HSG.SRT.C.6","body":"Understand that by similarity, side ratios in right triangles are properties of the angles in the triangle, leading to definitions of trigonometric ratios for acute angles.\n\nCluster: Define trigonometric ratios and solve problems involving right triangles\nCodes: CCSS.Math.Content.HSG-SRT.C.6, CCSS.Math.Content.HSG.SRT.C.6, G-SRT.6\n"},{"id":"CCSS.Math.Content.HSG.SRT.C.7","name":"CCSS.Math.Content.HSG.SRT.C.7","body":"Explain and use the relationship between the sine and cosine of complementary angles.\n\nCluster: Define trigonometric ratios and solve problems involving right triangles\nCodes: CCSS.Math.Content.HSG-SRT.C.7, CCSS.Math.Content.HSG.SRT.C.7, G-SRT.7\n"},{"id":"CCSS.Math.Content.HSG.SRT.C.8","name":"CCSS.Math.Content.HSG.SRT.C.8","body":"Use trigonometric ratios and the Pythagorean Theorem to solve right triangles in applied problems.\n\nCluster: Define trigonometric ratios and solve problems involving right triangles\nCodes: CCSS.Math.Content.HSG-SRT.C.8, CCSS.Math.Content.HSG.SRT.C.8, G-SRT.8\n"},{"id":"CCSS.Math.Content.HSG.SRT.D.10","name":"CCSS.Math.Content.HSG.SRT.D.10","body":"(+) Prove the Laws of Sines and Cosines and use them to solve problems.\n\nCluster: Apply trigonometry to general triangles\nCodes: CCSS.Math.Content.HSG-SRT.D.10, CCSS.Math.Content.HSG.SRT.D.10, G-SRT.10\n"},{"id":"CCSS.Math.Content.HSG.SRT.D.11","name":"CCSS.Math.Content.HSG.SRT.D.11","body":"(+) Understand and apply the Law of Sines and the Law of Cosines to find unknown measurements in right and non-right triangles (e.g., surveying problems, resultant forces).\n\nCluster: Apply trigonometry to general triangles\nCodes: CCSS.Math.Content.HSG-SRT.D.11, CCSS.Math.Content.HSG.SRT.D.11, G-SRT.11\n"},{"id":"CCSS.Math.Content.HSG.SRT.D.9","name":"CCSS.Math.Content.HSG.SRT.D.9","body":"(+) Derive the formula A = 1/2 ab sin(C) for the area of a triangle by drawing an auxiliary line from a vertex perpendicular to the opposite side.\n\nCluster: Apply trigonometry to general triangles\nCodes: CCSS.Math.Content.HSG-SRT.D.9, CCSS.Math.Content.HSG.SRT.D.9, G-SRT.9\n"},{"id":"CCSS.Math.Content.HSG.SRT","name":"CCSS.Math.Content.HSG.SRT","body":"Other codes: CCSS.Math.Content.HSG-SRT, CCSS.Math.Content.HSG.SRT, G-SRT\nRight Triangles, and Trigonometry "},{"id":"CCSS.Math.Content.HSN.CN.A.1","name":"CCSS.Math.Content.HSN.CN.A.1","body":"Know there is a complex number i such that i^2 = -1, and every complex number has the form a + bi with a and b real.\n\nCluster: Perform arithmetic operations with complex numbers\nCodes: CCSS.Math.Content.HSN-CN.A.1, CCSS.Math.Content.HSN.CN.A.1, N-CN.1\n"},{"id":"CCSS.Math.Content.HSN.CN.A.2","name":"CCSS.Math.Content.HSN.CN.A.2","body":"Use the relation i^2 = -1 and the commutative, associative, and distributive properties to add, subtract, and multiply complex numbers. \n\nCluster: Perform arithmetic operations with complex numbers\nCodes: CCSS.Math.Content.HSN-CN.A.2, CCSS.Math.Content.HSN.CN.A.2, N-CN.2\n"},{"id":"CCSS.Math.Content.HSN.CN.A.3","name":"CCSS.Math.Content.HSN.CN.A.3","body":"(+) Find the conjugate of a complex number; use conjugates to find moduli and quotients of complex numbers.\n\nCluster: Perform arithmetic operations with complex numbers\nCodes: CCSS.Math.Content.HSN-CN.A.3, CCSS.Math.Content.HSN.CN.A.3, N-CN.3\n"},{"id":"CCSS.Math.Content.HSN.CN.B.4","name":"CCSS.Math.Content.HSN.CN.B.4","body":"(+) Represent complex numbers on the complex plane in rectangular and polar form (including real and imaginary numbers), and explain why the rectangular and polar forms of a given complex number represent the same number.\n\nCluster: Represent complex numbers and their operations on the complex plane\nCodes: CCSS.Math.Content.HSN-CN.B.4, CCSS.Math.Content.HSN.CN.B.4, N-CN.4\n"},{"id":"CCSS.Math.Content.HSN.CN.B.5","name":"CCSS.Math.Content.HSN.CN.B.5","body":"(+) Represent addition, subtraction, multiplication, and conjugation of complex numbers geometrically on the complex plane; use properties of this representation for computation. For example, (-1 + 3 i)^3 = 8 because (-1 + 3 i) has modulus 2 and argument 120.\n\nCluster: Represent complex numbers and their operations on the complex plane\nCodes: CCSS.Math.Content.HSN-CN.B.5, CCSS.Math.Content.HSN.CN.B.5, N-CN.5\n"},{"id":"CCSS.Math.Content.HSN.CN.B.6","name":"CCSS.Math.Content.HSN.CN.B.6","body":"(+) Calculate the distance between numbers in the complex plane as the modulus of the difference, and the midpoint of a segment as the average of the numbers at its endpoints.\n\nCluster: Represent complex numbers and their operations on the complex plane\nCodes: CCSS.Math.Content.HSN-CN.B.6, CCSS.Math.Content.HSN.CN.B.6, N-CN.6\n"},{"id":"CCSS.Math.Content.HSN.CN.C.7","name":"CCSS.Math.Content.HSN.CN.C.7","body":"Solve quadratic equations with real coefficients that have complex solutions.\n\nCluster: Use complex numbers in polynomial identities and equations\nCodes: CCSS.Math.Content.HSN-CN.C.7, CCSS.Math.Content.HSN.CN.C.7, N-CN.7\n"},{"id":"CCSS.Math.Content.HSN.CN.C.8","name":"CCSS.Math.Content.HSN.CN.C.8","body":"(+) Extend polynomial identities to the complex numbers. For example, rewrite x^2 + 4 as (x + 2i)(x - 2i).\n\nCluster: Use complex numbers in polynomial identities and equations\nCodes: CCSS.Math.Content.HSN-CN.C.8, CCSS.Math.Content.HSN.CN.C.8, N-CN.8\n"},{"id":"CCSS.Math.Content.HSN.CN.C.9","name":"CCSS.Math.Content.HSN.CN.C.9","body":"(+) Know the Fundamental Theorem of Algebra; show that it is true for quadratic polynomials.\n\nCluster: Use complex numbers in polynomial identities and equations\nCodes: CCSS.Math.Content.HSN-CN.C.9, CCSS.Math.Content.HSN.CN.C.9, N-CN.9\n"},{"id":"CCSS.Math.Content.HSN.CN","name":"CCSS.Math.Content.HSN.CN","body":"Other codes: CCSS.Math.Content.HSN-CN, CCSS.Math.Content.HSN.CN, N-CN\nComplex Number System "},{"id":"CCSS.Math.Content.HSN.Q.A.1","name":"CCSS.Math.Content.HSN.Q.A.1","body":"Use units as a way to understand problems and to guide the solution of multi-step problems; choose and interpret units consistently in formulas; choose and interpret the scale and the origin in graphs and data displays.\n\nCluster: Reason quantitatively and use units to solve problems\nBig Ideas Algebra 1 Chapters: 1.2\nCodes: CCSS.Math.Content.HSN-Q.A.1, CCSS.Math.Content.HSN.Q.A.1, N-Q.1\n"},{"id":"CCSS.Math.Content.HSN.Q.A.2","name":"CCSS.Math.Content.HSN.Q.A.2","body":"Define appropriate quantities for the purpose of descriptive modeling. \n\nCluster: Reason quantitatively and use units to solve problems\nCodes: CCSS.Math.Content.HSN-Q.A.2, CCSS.Math.Content.HSN.Q.A.2, N-Q.2\n"},{"id":"CCSS.Math.Content.HSN.Q.A.3","name":"CCSS.Math.Content.HSN.Q.A.3","body":"Choose a level of accuracy appropriate to limitations on measurement when reporting quantities.\n\nCluster: Reason quantitatively and use units to solve problems\nCodes: CCSS.Math.Content.HSN-Q.A.3, CCSS.Math.Content.HSN.Q.A.3, N-Q.3\n"},{"id":"CCSS.Math.Content.HSN.Q","name":"CCSS.Math.Content.HSN.Q","body":"Other codes: CCSS.Math.Content.HSN-Q, CCSS.Math.Content.HSN.Q, N-Q\n"},{"id":"CCSS.Math.Content.HSN.RN.A.1","name":"CCSS.Math.Content.HSN.RN.A.1","body":"Explain how the definition of the meaning of rational exponents follows from extending the properties of integer exponents to those values, allowing for a notation for radicals in terms of rational exponents. For example, we define 5^(1/3) to be the cube root of 5 because we want (5^(1/3))^3 = 5^((1/3)3)) to hold, so (5^(1/3))^3 must equal 5.\n\nCluster: Extend the properties of exponents to rational exponents\nBig Ideas Algebra 1 Chapters: 6.2\nCodes: CCSS.Math.Content.HSN-RN.A.1, CCSS.Math.Content.HSN.RN.A.1, N-RN.1\n"},{"id":"CCSS.Math.Content.HSN.RN.A.2","name":"CCSS.Math.Content.HSN.RN.A.2","body":"Rewrite expressions involving radicals and rational exponents using the properties of exponents.\n\nCluster: Extend the properties of exponents to rational exponents\nBig Ideas Algebra 1 Chapters: 6.1, 6.2, 9.1\nCodes: CCSS.Math.Content.HSN-RN.A.2, CCSS.Math.Content.HSN.RN.A.2, N-RN.2\n"},{"id":"CCSS.Math.Content.HSN.RN.B.3","name":"CCSS.Math.Content.HSN.RN.B.3","body":"Explain why the sum or product of two rational numbers is rational; that the sum of a rational number and an irrational number is irrational; and that the product of a nonzero rational number and an irrational number is irrational.\n\nCluster: Use properties of rational and irrational numbers\nBig Ideas Algebra 1 Chapters: 9.1\nCodes: CCSS.Math.Content.HSN-RN.B.3, CCSS.Math.Content.HSN.RN.B.3, N-RN.3\n"},{"id":"CCSS.Math.Content.HSN.RN","name":"CCSS.Math.Content.HSN.RN","body":"Other codes: CCSS.Math.Content.HSN-RN, CCSS.Math.Content.HSN.RN, N-RN\nReal Number System"},{"id":"CCSS.Math.Content.HSN.VM.A.1","name":"CCSS.Math.Content.HSN.VM.A.1","body":"(+) Recognize vector quantities as having both magnitude and direction. Represent vector quantities by directed line segments, and use appropriate symbols for vectors and their magnitudes (e.g., v, |v|, ||v||, v).\n\nCluster: Represent and model with vector quantities\nCodes: CCSS.Math.Content.HSN-VM.A.1, CCSS.Math.Content.HSN.VM.A.1, N-VM.1\n"},{"id":"CCSS.Math.Content.HSN.VM.A.2","name":"CCSS.Math.Content.HSN.VM.A.2","body":"(+) Find the components of a vector by subtracting the coordinates of an initial point from the coordinates of a terminal point.\n\nCluster: Represent and model with vector quantities\nCodes: CCSS.Math.Content.HSN-VM.A.2, CCSS.Math.Content.HSN.VM.A.2, N-VM.2\n"},{"id":"CCSS.Math.Content.HSN.VM.A.3","name":"CCSS.Math.Content.HSN.VM.A.3","body":"(+) Solve problems involving velocity and other quantities that can be represented by vectors.\n\nCluster: Represent and model with vector quantities\nCodes: CCSS.Math.Content.HSN-VM.A.3, CCSS.Math.Content.HSN.VM.A.3, N-VM.3\n"},{"id":"CCSS.Math.Content.HSN.VM.B.4","name":"CCSS.Math.Content.HSN.VM.B.4","body":"(+) Add and subtract vectors.\n\nCluster: Perform operations on vectors\nCodes: CCSS.Math.Content.HSN-VM.B.4, CCSS.Math.Content.HSN.VM.B.4, N-VM.4\n"},{"id":"CCSS.Math.Content.HSN.VM.B.4a","name":"CCSS.Math.Content.HSN.VM.B.4a","body":"Add vectors end-to-end, component-wise, and by the parallelogram rule. Understand that the magnitude of a sum of two vectors is typically not the sum of the magnitudes.\n\nCluster: Perform operations on vectors\nCodes: CCSS.Math.Content.HSN-VM.B.4a, CCSS.Math.Content.HSN.VM.B.4a, N-VM.4a\n"},{"id":"CCSS.Math.Content.HSN.VM.B.4b","name":"CCSS.Math.Content.HSN.VM.B.4b","body":"Given two vectors in magnitude and direction form, determine the magnitude and direction of their sum.\n\nCluster: Perform operations on vectors\nCodes: CCSS.Math.Content.HSN-VM.B.4b, CCSS.Math.Content.HSN.VM.B.4b, N-VM.4b\n"},{"id":"CCSS.Math.Content.HSN.VM.B.4c","name":"CCSS.Math.Content.HSN.VM.B.4c","body":"Understand vector subtraction v - w as v + (-w), where -w is the additive inverse of w, with the same magnitude as w and pointing in the opposite direction. Represent vector subtraction graphically by connecting the tips in the appropriate order, and perform vector subtraction component-wise.\n\nCluster: Perform operations on vectors\nCodes: CCSS.Math.Content.HSN-VM.B.4c, CCSS.Math.Content.HSN.VM.B.4c, N-VM.4c\n"},{"id":"CCSS.Math.Content.HSN.VM.B.5","name":"CCSS.Math.Content.HSN.VM.B.5","body":"(+) Multiply a vector by a scalar.\n\nCluster: Perform operations on vectors\nCodes: CCSS.Math.Content.HSN-VM.B.5, CCSS.Math.Content.HSN.VM.B.5, N-VM.5\n"},{"id":"CCSS.Math.Content.HSN.VM.B.5a","name":"CCSS.Math.Content.HSN.VM.B.5a","body":"Represent scalar multiplication graphically by scaling vectors and possibly reversing their direction; perform scalar multiplication component-wise, e.g., as c(vx, vy) = (cvx, cvy).\n\nCluster: Perform operations on vectors\nCodes: CCSS.Math.Content.HSN-VM.B.5a, CCSS.Math.Content.HSN.VM.B.5a, N-VM.5a\n"},{"id":"CCSS.Math.Content.HSN.VM.B.5b","name":"CCSS.Math.Content.HSN.VM.B.5b","body":"Compute the magnitude of a scalar multiple cv using ||cv|| = |c|v. Compute the direction of cv knowing that when |c|v   0, the direction of cv is either along v (for c > 0) or against v (for c < 0).\n\nCluster: Perform operations on vectors\nCodes: CCSS.Math.Content.HSN-VM.B.5b, CCSS.Math.Content.HSN.VM.B.5b, N-VM.5b\n"},{"id":"CCSS.Math.Content.HSN.VM.C.10","name":"CCSS.Math.Content.HSN.VM.C.10","body":"(+) Understand that the zero and identity matrices play a role in matrix addition and multiplication similar to the role of 0 and 1 in the real numbers. The determinant of a square matrix is nonzero if and only if the matrix has a multiplicative inverse.\n\nCluster: Perform operations on matrices and use matrices in applications\nCodes: CCSS.Math.Content.HSN-VM.C.10, CCSS.Math.Content.HSN.VM.C.10, N-VM.10\n"},{"id":"CCSS.Math.Content.HSN.VM.C.11","name":"CCSS.Math.Content.HSN.VM.C.11","body":"(+) Multiply a vector (regarded as a matrix with one column) by a matrix of suitable dimensions to produce another vector. Work with matrices as transformations of vectors.\n\nCluster: Perform operations on matrices and use matrices in applications\nCodes: CCSS.Math.Content.HSN-VM.C.11, CCSS.Math.Content.HSN.VM.C.11, N-VM.11\n"},{"id":"CCSS.Math.Content.HSN.VM.C.12","name":"CCSS.Math.Content.HSN.VM.C.12","body":"(+) Work with 2  2 matrices as transformations of the plane, and interpret the absolute value of the determinant in terms of area.\n\nCluster: Perform operations on matrices and use matrices in applications\nCodes: CCSS.Math.Content.HSN-VM.C.12, CCSS.Math.Content.HSN.VM.C.12, N-VM.12\n"},{"id":"CCSS.Math.Content.HSN.VM.C.6","name":"CCSS.Math.Content.HSN.VM.C.6","body":"(+) Use matrices to represent and manipulate data, e.g., to represent payoffs or incidence relationships in a network.\n\nCluster: Perform operations on matrices and use matrices in applications\nCodes: CCSS.Math.Content.HSN-VM.C.6, CCSS.Math.Content.HSN.VM.C.6, N-VM.6\n"},{"id":"CCSS.Math.Content.HSN.VM.C.7","name":"CCSS.Math.Content.HSN.VM.C.7","body":"(+) Multiply matrices by scalars to produce new matrices, e.g., as when all of the payoffs in a game are doubled.\n\nCluster: Perform operations on matrices and use matrices in applications\nCodes: CCSS.Math.Content.HSN-VM.C.7, CCSS.Math.Content.HSN.VM.C.7, N-VM.7\n"},{"id":"CCSS.Math.Content.HSN.VM.C.8","name":"CCSS.Math.Content.HSN.VM.C.8","body":"(+) Add, subtract, and multiply matrices of appropriate dimensions.\n\nCluster: Perform operations on matrices and use matrices in applications\nCodes: CCSS.Math.Content.HSN-VM.C.8, CCSS.Math.Content.HSN.VM.C.8, N-VM.8\n"},{"id":"CCSS.Math.Content.HSN.VM.C.9","name":"CCSS.Math.Content.HSN.VM.C.9","body":"(+) Understand that, unlike multiplication of numbers, matrix multiplication for square matrices is not a commutative operation, but still satisfies the associative and distributive properties.\n\nCluster: Perform operations on matrices and use matrices in applications\nCodes: CCSS.Math.Content.HSN-VM.C.9, CCSS.Math.Content.HSN.VM.C.9, N-VM.9\n"},{"id":"CCSS.Math.Content.HSN.VM","name":"CCSS.Math.Content.HSN.VM","body":"Other codes: CCSS.Math.Content.HSN-VM, CCSS.Math.Content.HSN.VM, N-VM\nand Matrix Quantities "},{"id":"CCSS.Math.Content.HSS.CP.A.1","name":"CCSS.Math.Content.HSS.CP.A.1","body":"Describe events as subsets of a sample space (the set of outcomes) using characteristics (or categories) of the outcomes, or as unions, intersections, or complements of other events (\"or,\" \"and,\" \"not\"). \n\nCluster: Understand independence and conditional probability and use them to interpret data\nCodes: CCSS.Math.Content.HSS-CP.A.1, CCSS.Math.Content.HSS.CP.A.1, S-CP.1\n"},{"id":"CCSS.Math.Content.HSS.CP.A.2","name":"CCSS.Math.Content.HSS.CP.A.2","body":"Understand that two events A and B are independent if the probability of A and B occurring together is the product of their probabilities, and use this characterization to determine if they are independent.\n\nCluster: Understand independence and conditional probability and use them to interpret data\nCodes: CCSS.Math.Content.HSS-CP.A.2, CCSS.Math.Content.HSS.CP.A.2, S-CP.2\n"},{"id":"CCSS.Math.Content.HSS.CP.A.3","name":"CCSS.Math.Content.HSS.CP.A.3","body":"Understand the conditional probability of A given B as P(A and B)/P(B), and interpret independence of A and B as saying that the conditional probability of A given B is the same as the probability of A, and the conditional probability of B given A is the same as the probability of B.\n\nCluster: Understand independence and conditional probability and use them to interpret data\nCodes: CCSS.Math.Content.HSS-CP.A.3, CCSS.Math.Content.HSS.CP.A.3, S-CP.3\n"},{"id":"CCSS.Math.Content.HSS.CP.A.4","name":"CCSS.Math.Content.HSS.CP.A.4","body":"Construct and interpret two-way frequency tables of data when two categories are associated with each object being classified. Use the two-way table as a sample space to decide if events are independent and to approximate conditional probabilities. For example, collect data from a random sample of students in your school on their favorite subject among math, science, and English. Estimate the probability that a randomly selected student from your school will favor science given that the student is in tenth grade. Do the same for other subjects and compare the results.\n\nCluster: Understand independence and conditional probability and use them to interpret data\nCodes: CCSS.Math.Content.HSS-CP.A.4, CCSS.Math.Content.HSS.CP.A.4, S-CP.4\n"},{"id":"CCSS.Math.Content.HSS.CP.A.5","name":"CCSS.Math.Content.HSS.CP.A.5","body":"Recognize and explain the concepts of conditional probability and independence in everyday language and everyday situations. For example, compare the chance of having lung cancer if you are a smoker with the chance of being a smoker if you have lung cancer.\n\nCluster: Understand independence and conditional probability and use them to interpret data\nCodes: CCSS.Math.Content.HSS-CP.A.5, CCSS.Math.Content.HSS.CP.A.5, S-CP.5\n"},{"id":"CCSS.Math.Content.HSS.CP.B.6","name":"CCSS.Math.Content.HSS.CP.B.6","body":"Find the conditional probability of A given B as the fraction of B's outcomes that also belong to A, and interpret the answer in terms of the model.\n\nCluster: Use the rules of probability to compute probabilities of compound events in a uniform probability model\nCodes: CCSS.Math.Content.HSS-CP.B.6, CCSS.Math.Content.HSS.CP.B.6, S-CP.6\n"},{"id":"CCSS.Math.Content.HSS.CP.B.7","name":"CCSS.Math.Content.HSS.CP.B.7","body":"Apply the Addition Rule, P(A or B) = P(A) + P(B) - P(A and B), and interpret the answer in terms of the model.\n\nCluster: Use the rules of probability to compute probabilities of compound events in a uniform probability model\nCodes: CCSS.Math.Content.HSS-CP.B.7, CCSS.Math.Content.HSS.CP.B.7, S-CP.7\n"},{"id":"CCSS.Math.Content.HSS.CP.B.8","name":"CCSS.Math.Content.HSS.CP.B.8","body":"(+) Apply the general Multiplication Rule in a uniform probability model, P(A and B) = P(A)P(B|A) = P(B)P(A|B), and interpret the answer in terms of the model. \n\nCluster: Use the rules of probability to compute probabilities of compound events in a uniform probability model\nCodes: CCSS.Math.Content.HSS-CP.B.8, CCSS.Math.Content.HSS.CP.B.8, S-CP.8\n"},{"id":"CCSS.Math.Content.HSS.CP.B.9","name":"CCSS.Math.Content.HSS.CP.B.9","body":"(+) Use permutations and combinations to compute probabilities of compound events and solve problems.\n\nCluster: Use the rules of probability to compute probabilities of compound events in a uniform probability model\nCodes: CCSS.Math.Content.HSS-CP.B.9, CCSS.Math.Content.HSS.CP.B.9, S-CP.9\n"},{"id":"CCSS.Math.Content.HSS.CP","name":"CCSS.Math.Content.HSS.CP","body":"Other codes: CCSS.Math.Content.HSS-CP, CCSS.Math.Content.HSS.CP, S-CP\nProbability and the Rules of Probability "},{"id":"CCSS.Math.Content.HSS.IC.A.1","name":"CCSS.Math.Content.HSS.IC.A.1","body":"Understand statistics as a process for making inferences about population parameters based on a random sample from that population.\n\nCluster: Understand and evaluate random processes underlying statistical experiments\nCodes: CCSS.Math.Content.HSS-IC.A.1, CCSS.Math.Content.HSS.IC.A.1, S-IC.1\n"},{"id":"CCSS.Math.Content.HSS.IC.A.2","name":"CCSS.Math.Content.HSS.IC.A.2","body":"Decide if a specified model is consistent with results from a given data-generating process, e.g., using simulation. For example, a model says a spinning coin falls heads up with probability 0.5. Would a result of 5 tails in a row cause you to question the model?\n\nCluster: Understand and evaluate random processes underlying statistical experiments\nCodes: CCSS.Math.Content.HSS-IC.A.2, CCSS.Math.Content.HSS.IC.A.2, S-IC.2\n"},{"id":"CCSS.Math.Content.HSS.IC.B.3","name":"CCSS.Math.Content.HSS.IC.B.3","body":"Recognize the purposes of and differences among sample surveys, experiments, and observational studies; explain how randomization relates to each.\n\nCluster: Make inferences and justify conclusions from sample surveys, experiments, and observational studies\nCodes: CCSS.Math.Content.HSS-IC.B.3, CCSS.Math.Content.HSS.IC.B.3, S-IC.3\n"},{"id":"CCSS.Math.Content.HSS.IC.B.4","name":"CCSS.Math.Content.HSS.IC.B.4","body":"Use data from a sample survey to estimate a population mean or proportion; develop a margin of error through the use of simulation models for random sampling.\n\nCluster: Make inferences and justify conclusions from sample surveys, experiments, and observational studies\nCodes: CCSS.Math.Content.HSS-IC.B.4, CCSS.Math.Content.HSS.IC.B.4, S-IC.4\n"},{"id":"CCSS.Math.Content.HSS.IC.B.5","name":"CCSS.Math.Content.HSS.IC.B.5","body":"Use data from a randomized experiment to compare two treatments; use simulations to decide if differences between parameters are significant.\n\nCluster: Make inferences and justify conclusions from sample surveys, experiments, and observational studies\nCodes: CCSS.Math.Content.HSS-IC.B.5, CCSS.Math.Content.HSS.IC.B.5, S-IC.5\n"},{"id":"CCSS.Math.Content.HSS.IC.B.6","name":"CCSS.Math.Content.HSS.IC.B.6","body":"Evaluate reports based on data.\n\nCluster: Make inferences and justify conclusions from sample surveys, experiments, and observational studies\nCodes: CCSS.Math.Content.HSS-IC.B.6, CCSS.Math.Content.HSS.IC.B.6, S-IC.6\n"},{"id":"CCSS.Math.Content.HSS.IC","name":"CCSS.Math.Content.HSS.IC","body":"Other codes: CCSS.Math.Content.HSS-IC, CCSS.Math.Content.HSS.IC, S-IC\nInferences and Justifying Conclusions "},{"id":"CCSS.Math.Content.HSS.ID.A.1","name":"CCSS.Math.Content.HSS.ID.A.1","body":"Represent data with plots on the real number line (dot plots, histograms, and box plots).\n\nCluster: Summarize, represent, and interpret data on a single count or measurement variable\nBig Ideas Algebra 1 Chapters: 11.2, 11.3, 11.5\nCodes: CCSS.Math.Content.HSS-ID.A.1, CCSS.Math.Content.HSS.ID.A.1, S-ID.1\n"},{"id":"CCSS.Math.Content.HSS.ID.A.2","name":"CCSS.Math.Content.HSS.ID.A.2","body":"Use statistics appropriate to the shape of the data distribution to compare center (median, mean) and spread (interquartile range, standard deviation) of two or more different data sets.\n\nCluster: Summarize, represent, and interpret data on a single count or measurement variable\nBig Ideas Algebra 1 Chapters: 11.2\nCodes: CCSS.Math.Content.HSS-ID.A.2, CCSS.Math.Content.HSS.ID.A.2, S-ID.2\n"},{"id":"CCSS.Math.Content.HSS.ID.A.3","name":"CCSS.Math.Content.HSS.ID.A.3","body":"Interpret differences in shape, center, and spread in the context of the data sets, accounting for possible effects of extreme data points (outliers).\n\nCluster: Summarize, represent, and interpret data on a single count or measurement variable\nBig Ideas Algebra 1 Chapters: 11.1, 11.2, 11.3\nCodes: CCSS.Math.Content.HSS-ID.A.3, CCSS.Math.Content.HSS.ID.A.3, S-ID.3\n"},{"id":"CCSS.Math.Content.HSS.ID.A.4","name":"CCSS.Math.Content.HSS.ID.A.4","body":"Use the mean and standard deviation of a data set to fit it to a normal distribution and to estimate population percentages. Recognize that there are data sets for which such a procedure is not appropriate. Use calculators, spreadsheets, and tables to estimate areas under the normal curve.\n\nCluster: Summarize, represent, and interpret data on a single count or measurement variable\nCodes: CCSS.Math.Content.HSS-ID.A.4, CCSS.Math.Content.HSS.ID.A.4, S-ID.4\n"},{"id":"CCSS.Math.Content.HSS.ID.B.5","name":"CCSS.Math.Content.HSS.ID.B.5","body":"Summarize categorical data for two categories in two-way frequency tables. Interpret relative frequencies in the context of the data (including joint, marginal, and conditional relative frequencies). Recognize possible associations and trends in the data. \n\nCluster: Summarize, represent, and interpret data on two categorical and quantitative variables\nBig Ideas Algebra 1 Chapters: 11.4\nCodes: CCSS.Math.Content.HSS-ID.B.5, CCSS.Math.Content.HSS.ID.B.5, S-ID.5\n"},{"id":"CCSS.Math.Content.HSS.ID.B.6","name":"CCSS.Math.Content.HSS.ID.B.6","body":"Represent data on two quantitative variables on a scatter plot, and describe how the variables are related.\n\nCluster: Summarize, represent, and interpret data on two categorical and quantitative variables\nCodes: CCSS.Math.Content.HSS-ID.B.6, CCSS.Math.Content.HSS.ID.B.6, S-ID.6\n"},{"id":"CCSS.Math.Content.HSS.ID.B.6a","name":"CCSS.Math.Content.HSS.ID.B.6a","body":"Fit a function to the data; use functions fitted to data to solve problems in the context of the data. Use given functions or choose a function suggested by the context. Emphasize linear, quadratic, and exponential models.\n\nCluster: Summarize, represent, and interpret data on two categorical and quantitative variables\nBig Ideas Algebra 1 Chapters: 4.4, 4.5\nCodes: CCSS.Math.Content.HSS-ID.B.6a, CCSS.Math.Content.HSS.ID.B.6a, S-ID.6a\n"},{"id":"CCSS.Math.Content.HSS.ID.B.6b","name":"CCSS.Math.Content.HSS.ID.B.6b","body":"Informally assess the fit of a function by plotting and analyzing residuals.\n\nCluster: Summarize, represent, and interpret data on two categorical and quantitative variables\nBig Ideas Algebra 1 Chapters: 4.5\nCodes: CCSS.Math.Content.HSS-ID.B.6b, CCSS.Math.Content.HSS.ID.B.6b, S-ID.6b\n"},{"id":"CCSS.Math.Content.HSS.ID.B.6c","name":"CCSS.Math.Content.HSS.ID.B.6c","body":"Fit a linear function for a scatter plot that suggests a linear association.\n\nCluster: Summarize, represent, and interpret data on two categorical and quantitative variables\nBig Ideas Algebra 1 Chapters: 4.4, 4.5\nCodes: CCSS.Math.Content.HSS-ID.B.6c, CCSS.Math.Content.HSS.ID.B.6c, S-ID.6c\n"},{"id":"CCSS.Math.Content.HSS.ID.C.7","name":"CCSS.Math.Content.HSS.ID.C.7","body":"Interpret the slope (rate of change) and the intercept (constant term) of a linear model in the context of the data.\n\nCluster: Interpret linear models\nBig Ideas Algebra 1 Chapters: 4.4, 4.5\nCodes: CCSS.Math.Content.HSS-ID.C.7, CCSS.Math.Content.HSS.ID.C.7, S-ID.7\n"},{"id":"CCSS.Math.Content.HSS.ID.C.8","name":"CCSS.Math.Content.HSS.ID.C.8","body":"Compute (using technology) and interpret the correlation coefficient of a linear fit.\n\nCluster: Interpret linear models\nBig Ideas Algebra 1 Chapters: 4.5\nCodes: CCSS.Math.Content.HSS-ID.C.8, CCSS.Math.Content.HSS.ID.C.8, S-ID.8\n"},{"id":"CCSS.Math.Content.HSS.ID.C.9","name":"CCSS.Math.Content.HSS.ID.C.9","body":"Distinguish between correlation and causation.\n\nCluster: Interpret linear models\nBig Ideas Algebra 1 Chapters: 4.5\nCodes: CCSS.Math.Content.HSS-ID.C.9, CCSS.Math.Content.HSS.ID.C.9, S-ID.9\n"},{"id":"CCSS.Math.Content.HSS.ID","name":"CCSS.Math.Content.HSS.ID","body":"Other codes: CCSS.Math.Content.HSS-ID, CCSS.Math.Content.HSS.ID, S-ID\nCategorical and Quantitative Data "},{"id":"CCSS.Math.Content.HSS.MD.A.1","name":"CCSS.Math.Content.HSS.MD.A.1","body":"(+) Define a random variable for a quantity of interest by assigning a numerical value to each event in a sample space; graph the  corresponding probability distribution using the same graphical displays as for data distributions.\n\nCluster: Calculate expected values and use them to solve problems\nCodes: CCSS.Math.Content.HSS-MD.A.1, CCSS.Math.Content.HSS.MD.A.1, S-MD.1\n"},{"id":"CCSS.Math.Content.HSS.MD.A.2","name":"CCSS.Math.Content.HSS.MD.A.2","body":"(+) Calculate the expected value of a random variable; interpret it as the mean of the probability distribution.\n\nCluster: Calculate expected values and use them to solve problems\nCodes: CCSS.Math.Content.HSS-MD.A.2, CCSS.Math.Content.HSS.MD.A.2, S-MD.2\n"},{"id":"CCSS.Math.Content.HSS.MD.A.3","name":"CCSS.Math.Content.HSS.MD.A.3","body":"(+) Develop a probability distribution for a random variable defined for a sample space in which theoretical probabilities can be calculated; find the expected value. For example, find the theoretical probability distribution for the number of correct answers obtained by guessing on all five questions of a multiple-choice test where each question has four choices, and find the expected grade under various grading schemes.\n\nCluster: Calculate expected values and use them to solve problems\nCodes: CCSS.Math.Content.HSS-MD.A.3, CCSS.Math.Content.HSS.MD.A.3, S-MD.3\n"},{"id":"CCSS.Math.Content.HSS.MD.A.4","name":"CCSS.Math.Content.HSS.MD.A.4","body":"(+) Develop a probability distribution for a random variable defined for a sample space in which probabilities are assigned empirically; find the expected value. For example, find a current data distribution on the number of TV sets per household in the United States, and calculate the expected number of sets per household. How many TV sets would you expect to find in 100 randomly selected households?\n\nCluster: Calculate expected values and use them to solve problems\nCodes: CCSS.Math.Content.HSS-MD.A.4, CCSS.Math.Content.HSS.MD.A.4, S-MD.4\n"},{"id":"CCSS.Math.Content.HSS.MD.B.5","name":"CCSS.Math.Content.HSS.MD.B.5","body":"(+) Weigh the possible outcomes of a decision by assigning probabilities to payoff values and finding expected values.\n\nCluster: Use probability to evaluate outcomes of decisions\nCodes: CCSS.Math.Content.HSS-MD.B.5, CCSS.Math.Content.HSS.MD.B.5, S-MD.5\n"},{"id":"CCSS.Math.Content.HSS.MD.B.5a","name":"CCSS.Math.Content.HSS.MD.B.5a","body":"Find the expected payoff for a game of chance. For example, find the expected winnings from a state lottery ticket or a game at a fastfood restaurant.\n\nCluster: Use probability to evaluate outcomes of decisions\nCodes: CCSS.Math.Content.HSS-MD.B.5a, CCSS.Math.Content.HSS.MD.B.5a, S-MD.5a\n"},{"id":"CCSS.Math.Content.HSS.MD.B.5b","name":"CCSS.Math.Content.HSS.MD.B.5b","body":"Evaluate and compare strategies on the basis of expected values. For example, compare a high-deductible versus a low-deductible automobile insurance policy using various, but reasonable, chances of having a minor or a major accident.\n\nCluster: Use probability to evaluate outcomes of decisions\nCodes: CCSS.Math.Content.HSS-MD.B.5b, CCSS.Math.Content.HSS.MD.B.5b, S-MD.5b\n"},{"id":"CCSS.Math.Content.HSS.MD.B.6","name":"CCSS.Math.Content.HSS.MD.B.6","body":"(+) Use probabilities to make fair decisions (e.g., drawing by lots, using a random number generator).\n\nCluster: Use probability to evaluate outcomes of decisions\nCodes: CCSS.Math.Content.HSS-MD.B.6, CCSS.Math.Content.HSS.MD.B.6, S-MD.6\n"},{"id":"CCSS.Math.Content.HSS.MD.B.7","name":"CCSS.Math.Content.HSS.MD.B.7","body":"(+) Analyze decisions and strategies using probability concepts (e.g., product testing, medical testing, pulling a hockey goalie at the end of a game).\n\nCluster: Use probability to evaluate outcomes of decisions\nCodes: CCSS.Math.Content.HSS-MD.B.7, CCSS.Math.Content.HSS.MD.B.7, S-MD.7\n"},{"id":"CCSS.Math.Content.HSS.MD","name":"CCSS.Math.Content.HSS.MD","body":"Other codes: CCSS.Math.Content.HSS-MD, CCSS.Math.Content.HSS.MD, S-MD\nProbability to Make Decisions "}]

